import React from 'react';

function QuestionAnswers(props) {
    if (props.answers.length > 0) {
        return (
            <ol>
                <li>{props.answers[0].text}</li>
            </ol>
        )
    } else {
        return null;
    }
}

export default QuestionAnswers;
